import React from 'react';
import { IonHeader, IonToolbar, IonTitle, IonContent, IonButton } from '@ionic/react';
import { withRouter } from "react-router";
import ExploreContainer from './ExploreContainer';

const Tab1: React.FC<any> = (props) => {
  return (
    <>
        <IonHeader>
            <IonToolbar>
            <IonTitle>Tab One</IonTitle>
            </IonToolbar>
        </IonHeader>

        <IonContent>
            <IonButton
            expand="full"
            style={{ margin: "14" }}
            onClick={e => {
                e.preventDefault();
                props.history.push("/u/openHouseMain/programmeTalksTab/tab1-detail");
            }}> NEXT PAGE</IonButton>

            <ExploreContainer name="Tab 1 page" />
        </IonContent>
    </>
  );
};

export default Tab1;
